import React from 'react';

const NavigationBar: React.FC = () => {
  return (
    <div className="relative top-10 ml-56 z-3 flex flex-col space-y-0">
      <div className="flex gap-24 font-work-sans">
        <button className="border-none bg-none p-2.5 cursor-pointer text-gray-400 text-xs">Field Officer</button>
        <button className="border-none bg-none p-2.5 cursor-pointer text-gray-400 text-xs">Task Management</button>
        <button className="border-none bg-none p-2.5 cursor-pointer text-gray-400 text-xs">Leave Management</button>
        <button className="border-none bg-none p-2.5 cursor-pointer text-gray-400 text-xs">Tracking</button>
        <div className="text-green-500">
          <button className="relative bg-none p-2.5 border-b-2 border-green-500 cursor-pointer text-green-500 text-xs">
            FO Msg System
          </button>
        </div>
      </div>
      <div className="w-full text-gray-200">
        <hr className="m-0 border-none h-0.5 bg-gray-200" />
      </div>
    </div>
  );
}

export default NavigationBar;
